    nullnt}],nt"num_resources": 7,nt"tags": [],nt"title": "NOS_5m_INT_HS.tif:
    5-meter hillshaded-relief image produced from 23 multibeam hydrographic surveys
    collected off the Delmarva Peninsula by the National Oceanic and Atmospheric Administration's
    National Ocean Service between 2006 and 2011 (GeoTIFF, UTM Zone 18N, WGS 84)",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-20T03:19:51.091677",nt"name": "nos-5m-int-hs-tif-5-meter-hillshaded-relief-image-produced-from-23-multibeam-hydrographic-su-846b056",nt"isopen":
    false,nt"url": null,nt"notes": "Between 2006 and 2011 Science Applications
    International Corporation (SAIC), under contract by the National Oceanic and Atmospheric
    Administration's (NOAA) National Ocean Service (NOS), collected twenty-three hydrographic
    surveys totaling over 4100 square-kilometers of Reson multibeam bathymetric and
    Klein sidescan-sonar data for the purposes of updating nautical charts. Data extended
    from the entrance of Delaware Bay south to Parramore Island in water depths from
    about 3 to 35 meters below mean lower low water. Data were collected at a fixed
    40-meter line spacing which provided 40-100 percent seafloor coverage for multibeam
    bathymetry. NOS releases processed bathymetry via an interactive map interface in
    bathymetry attributed grid (BAG) format. All twenty-three survey datasets were downloaded,
    merged, resampled, and interpolated to fill data gaps. Sidescan data products are
    limited within the Delmarva survey area and there are no multibeam backscatter data
    products available. The U.S. Geological Survey obtained the raw Reson multibeam
    data files from SAIC and NOAA for twenty of the hydrographic surveys and extracted
    the backscatter data using Quality Positioning Service's (QPS) Fledermaus FMGeocoder
    Toolbox (FMGT) to produce backscatter mosaics for the inner-continental shelf of
    the Delmarva Peninsula. Backscatter mosaics and regional seamless bathymetric datasets
    created from NOAA data are a valuable tool for characterizing seafloor geology,
    sediment transport pathways, and marine resources. Additionally, obtaining this
    near full seafloor coverage backscatter and bathymetry dataset from an existing
    source greatly increased project deliverables, geophysical survey efficiency, collaboration
    among government agencies, and the area over which geologic data interpretations
    can be conducted by the USGS.",nt"license_title": null,nt"extras": [{ntt"key":
